// ==UserScript==
// @name         Peapods money sound
// @namespace    http://tampermonkey.net/
// @version      2025-07-12
// @description  Plays a money sound (the mario coin sound) whenever a lending position receives yield.
// @author       You
// @match        https://peapods.finance/me
// @icon         https://www.google.com/s2/favicons?sz=64&domain=peapods.finance
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/542376/Peapods%20money%20sound.user.js
// @updateURL https://update.greasyfork.org/scripts/542376/Peapods%20money%20sound.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const cl = console.log
    // Mario coin sound
    const moneySoundB64 = ''
    const moneySound = new Audio(`data:audio/mp3;base64,${moneySoundB64}`);

    function onPositionSizeChange(oldText, newText, podLabel) {
        // Extract the dollar values in parentheses
        const extractValue = text => {
            const match = text.match(/\(\$(\d[\d,]*)\)/);
            if (!match) return null;
            return parseFloat(match[1].replace(/,/g, ''));
        };

        const oldValue = extractValue(oldText);
        const newValue = extractValue(newText);

        if (oldValue !== null && newValue !== null) {
            const diff = newValue - oldValue;
            cl(`${podLabel} | Old: $${oldValue.toLocaleString()} | New: $${newValue.toLocaleString()} | Profit: $${diff.toLocaleString()}`)
        } else {
            console.warn('Could not parse one of the values.');
        }

        moneySound.play();
    }

    function debounce(fn, delay) {
        let timer;
        return function (...args) {
            clearTimeout(timer);
            timer = setTimeout(() => fn(...args), delay);
        };
    }

    function getPodLabel (card) {
        const span = Array.from(card.querySelectorAll('span'))
        .find(s => s.textContent.trim() === 'Pod Lending');

        // Go up 2 levels
        const target = span?.parentElement?.parentElement;
        if (!target) return;

        const podLabel = target.innerText.replace('Pod Lending\n', '').replace(' (view)', '')

        return podLabel
    }

    const selector = '.grid.items-stretch';
    const observedTargets = new WeakSet();

    // Watch for new cards and monitor updates to Position Size
    const debouncedCheck = debounce(() => {
        const container = document.querySelector(selector);
        if (!container) return;

        Array.from(container.children).forEach(child => {
            if (observedTargets.has(child)) {
                return
            }
            // Track this target so we don't observe it again
            observedTargets.add(child);

            // Find span with exact text "Position Size"
            const span = Array.from(child.querySelectorAll('span'))
            .find(s => s.textContent.trim() === 'Position Size');

            // Go up 2 levels
            const target = span?.parentElement?.parentElement;
            if (!target) return;

            const podLabel = getPodLabel(child)

            // Track text changes
            let lastText = target.innerText;
            const observer = new MutationObserver(() => {
                const newText = target.innerText;
                if (newText !== lastText) {
                    onPositionSizeChange(lastText, newText, podLabel);
                    lastText = newText;
                }
            });

            observer.observe(target, {
                childList: true,
                subtree: true,
                characterData: true
            });
        });
    }, 300); // adjust delay if needed

    // Global observer for entire HTML changes
    const htmlObserver = new MutationObserver(debouncedCheck);
    htmlObserver.observe(document.documentElement, {
        childList: true,
        subtree: true,
    });

    debouncedCheck();
})();